import React from 'react'
import { Steps } from 'antd';
const {Step} = Steps;
import _ from 'lodash'
import {NavBarStatus} from '../../model/model'
import styled from 'styled-components'

const StepsStyled = styled(Steps)`
    font-family: 'Mark Pro';
    padding-bottom: 20px; 
    justify-content: center;
`

interface OnboardNavbarProps {
    currentStep: number;
}

const STEPS = [
    "Intro",
    "Build Your Profile",
    "Get Started"
];

export const OnboardNavbar: React.FC<OnboardNavbarProps> = (props) => {

    return (
        <Steps current={props.currentStep}>
            {_.map(STEPS, (step) => {
                return (<Step title={step}/>)
            })}
        </Steps>
    );
}
